import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, ScrollView, TextInput, Image, Platform } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={styles.containerText}>第一个demo，现在开始</Text>
      <StatusBar style="auto" />
      <ScrollView>
        <Text>文本</Text>
        <TextInput></TextInput>
        <Image source={logo}/>
      </ScrollView>
      <FlatList></FlatList>
    </View>
  );
}
const logo = {
  url:'',
  width: 100,
  height: 100
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    color: Platform.OS===web?'red':'black',
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  containerText: {
    color: 'red',
    fontSize: '10px',
    //select方法，可以系统为key，返回特定样式
    ...Platform.select({
      ios: {
        backgroundColor: 'red'
      },
      android: {
        backgroundColor: 'blue'
      }
    })
  }
});
